  \"npp-temperate-forest-humboldt-redwoods-state-park-california-usa-1972-2001-r1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains site characteristics,
  stand descriptors, and measured and calculated above-ground biomass, above-ground
  net primary production (ANPP), and woody detritus input data for an old Sequoia
  sempervirens stand at Bull Creek in Humboldt Redwoods State Park, California. There
  is one data file (.csv format) with this data set. Productivity of the Sequoia stand
  was studied via tree re-measurement (1972 and 2001) and allometric relationships.
  Measurements of tree circumference at 1.7 m above ground were made at the beginning
  and the end of the study. A 1972 stem map of the stand allowed the investigators
  to identify and re-measure trees >10 cm in diameter. ANPP was estimated using a
  range of specific gravities and several allometric relationships for tree volume.
  Estimation procedures were outlined by Busing and Fujimori (2005). Tree loss to
  mortality over the study interval was included in the analysis. Estimates of total
  tree ANPP ranged from 600 to 1,400 g/m2/yr. However, ANPP values in the range of
  700-1,000 g/m2/yr were considered to be the most reasonable estimate because of
  the accuracy of the particular equations, specific gravities, and assumptions used
  to obtain them (Busing and Fujimori, 2005). Above-ground total tree biomass was
  extremely high (> 300,000 g/m2). Revision Notes: Only the documentation for this
  data set has been modified. The data files have been checked for accuracy and are
  identical to those originally published in 2005. \",\n\t\"license_title\": \"U.S.
